import { HeaderOnly } from '~/components/Layout';
import { Home, Following, Profile, Upload } from '~/pages';
const PublicRoutes = [
    {
        path: '/',
        name: 'Home',
        component: Home,
    },
    {
        path: '/following',
        name: 'Following',
        component: Following,
    },
    {
        path: '/profile',
        name: 'Profile',
        component: Profile,
    },
    {
        path: '/upload',
        name: 'Upload',
        component: Upload,
        layout: HeaderOnly,
    },
];
const PrivateRoutes = [];
export { PublicRoutes, PrivateRoutes };
